def main():
    n = int(input())
    a = [[] for _ in range(n)]
    for i in range(n):
        a[i] = list(map(int, input().split()))
    for i in range(n):
        a[i][0] -= 1
        a[i][1] -= 1
    for i in range(n):
        if len(a[i]) == 2:
            j = a[i][0]
            if a[j][0] == i:
                a[j][0] = a[j][1]
                a[j].pop()
            else:
                a[j][1] = a[j][0]
                a[j][0] = i
            if a[j][0] == j:
                a[j].pop()
            a[i].pop()
    for i in range(n):
        a[i] = a[i][0]
    ans = [0] * n
    for i in range(n):
        ans[i] = i + 1
    for i in range(n):
        j = a[i]
        ans[i], ans[j] = ans[j], ans[i]
    print(*ans)


if __name__ == '__main__':
    main()
from collections import defaultdict

def solve(n, a):
    d = defaultdict(set)
    for i in range(1, n + 1):
        d[a[i][0]].add(i)
        d[a[i][1]].add(i)
    start = 1
    for i in range(1, n + 1):
        if len(d[i]) == 1:
            start = i
            break
    res = []
    for i in range(n):
        res.append(start)
        start = a[start][0] if a[start][0] != res[-1] else a[start][1]
    return ' '.join(map(str, res))

n = int(input())
a = defaultdict(list)
for i in range(n):
    a[i + 1] = list(map(int, input().split()))
print(solve(n, a))

